(1, '2018年世界杯:足坛风云变幻 中国足球需奋勇直追', '2018-7-27', 1, '123456\r\n', '   2018年世界杯:足坛风云变幻 中国足球需奋勇直追\r\n\r\n   15日，一场瓢泼大雨中，法国队再次高高举起大力神杯，2018年俄罗斯世界杯随之大幕落下。法国、比利时、英格兰等劲旅刮起一场青春风暴，冲击着旧有的世界足坛格局。面对风云变幻的世界足坛，中国足球需奋勇直追，早日实现再次踏上世界杯赛场的梦想。\r\n\r\n   当今的世界足坛正在经历球员换代更替。获得本届世界杯最佳新秀奖的法国队19岁的姆巴佩，以6球夺得金靴奖、即将年满25岁的英格兰队长凯恩，比利时队25岁的卢卡库等一批年轻球员在世界杯赛场上散发出耀眼光芒。\"90后\"球员开始\"抢班夺权\"，\"80后\"在逐步退出舞台，\"70后\"已完成谢幕演出。\r\n踏上俄罗斯赛场时，\"高卢雄鸡\"全队平均年龄26岁零10天。决赛中以4:2战胜克罗地亚队，再次高高举起大力神杯，曾夺得1998年世界杯冠军的法国队成为继1970年夺冠的巴西队(平均年龄25岁零5天开始世界杯决赛圈征程)后，世界杯历史上第二年轻的夺冠球队。\r\n在青春风暴的冲击下，面对更加简洁实用的技战术，传统强队纷纷折戟沉沙，卫冕冠军德国队止步小组赛，上届亚军阿根廷队16强战出局，2010年世界杯冠军西班牙队同样未能晋级8强，\"五星巴西\"在四分之一决赛中则被比利时队拉下马。\r\n   反观没有强将的弱旅，依靠球员间的默契协作，却踢出了属于自己、也属于世界杯的精彩。首次出征世界杯的冰岛队小组赛首轮1:1逼平阿根廷队;同样在小组赛中，巴拿马队即便以大比分败给英格兰队，却仍敢于亮剑，拼进球队世界杯首粒进球。\r\n\r\n   当今的世界足坛格局正处在变化中，欧洲足球继续领跑，南美足球紧紧跟随，亚洲和非洲足球努力追赶。\r\n   小组赛战罢，16强中欧洲有10支球队一家独大，南美4队，墨西哥队成为北中美和加勒比地区仅剩火种，亚洲5支球队只有日本队晋级，5支非洲球队则\"全军覆没\"。\r\n随着比赛速度更快、对抗更强，球员个人能力之间的差异日益缩小，强队之间的差距也正在缩小。16强战中，俄罗斯淘汰西班牙，克罗地亚战胜丹麦，英格兰拿下哥伦比亚，都是经过加时赛，最终通过残酷的点球大战决出胜负。克罗地亚队在四分之一决赛中同样上演点球大战，险胜俄罗斯队。半决赛中，克罗地亚队遭遇该队在本届杯赛上的第三个加时赛，以2:1将英格兰队送回了家。\r\n    本届世界杯，虽然亚洲足球整体上并未获得突破，但表现依旧可圈可点。韩国队在最后一场小组赛中以2:0战胜卫冕冠军德国队，爆出大冷门。日本队在16强战中对阵比利时队获得2:0领先后依旧与对手展开对攻，虽最终以2:3惜败，但勇于挑战和拼搏的精神赢得尊敬。此外，伊朗队小组赛中逼平2016年欧锦赛冠军葡萄牙队，沙特队也在最后一轮小组赛中取得一场胜利。\r\n1   6强战过后，6支欧洲队伍晋级。接下来，随着南美仅剩的乌拉圭和巴西队相继出局，4强席位全被欧洲球队占据，世界杯就此变身\"欧洲杯\"。\r\n   在季军争夺战中，比利时队以2:0战胜英格兰队，获得球队历史上最好成绩。此前，\"欧洲红魔\"的最好成绩是1986年的第四名。\r\n尽管未能实现夺冠愿望，获得亚军的克罗地亚队同样创造历史最好成绩，球队核心莫德里奇获得金球奖。\r\n\r\n   当今的世界足坛处于变革的时代，新科技的运用令比赛更加公平，在世界杯赛场上使用的VAR(视频裁判助理)让马拉多纳当年的\"上帝之手\"难以再现。\r\n   本届世界杯最大的变化莫过于引入了VAR，得益于科技手段的介入，比赛中的每个时刻都能够被全景记录下来。有VAR作为保障，裁判员既能对球员身体对抗尺度持更加开放的态度，同时又大大降低了漏判和误判的可能性。\r\n不过，也有持保留意见的足坛人士认为，VAR的使用打乱了比赛的节奏，减少了足球的悬念和魅力。\r\n\"判罚是公正的，但问题在于究竟是谁决定比赛的进行。是草坪上的裁判，还是在\'小黑屋\'里的人?VAR将使足球失去魅力。\"在澳大利亚与丹麦的比赛后，吃了亏的丹麦主帅哈雷德虽然对视频助理判定的点球没有异议，但还是忍不住要吐槽两句。\r\n根据国际足联的统计，前62场比赛，裁判们比赛中共观看了19次VAR回放，更正了16个不正确的判决。\r\n国际足联主席因凡蒂诺13日曾表示，VAR的使用让裁判的判罚准确率从95%提高到99.2%，\"16个判罚被改变，16个错误决定变成了16个正确决定\"。\r\n15日的决赛中，VAR再次成为场上焦点。主裁判在上半场求助VAR，改判法国队1粒点球。凭借这粒点球获得2:1领先的\"高卢雄鸡\"随后掌控了场上局面，并最终以4:2胜出夺冠。\r\n俄罗斯交出满意答卷国际足联主席赞赏有加\r\n俄罗斯世界杯大幕落下，64场比赛顺利进行，俄罗斯兑现了\"向世界展现一个新的、热情的俄罗斯\"这个2010年申办世界杯时的目标。\r\n俄罗斯队晋级八强，振奋了整个俄罗斯。俄罗斯民意调查机构全俄社会舆论研究中心12日公布的一项民意调查数据显示，俄罗斯足球队在本届世界杯上的表现让俄民众感到骄傲、喜悦和尊重。\r\n举办世界杯让俄罗斯在经济上受益匪浅。俄罗斯世界杯组委会主席德沃尔科维奇表示，本届世界杯为俄罗斯带来的综合收益预计达到150亿美元。\r\n世界杯还成为世界了解俄罗斯的一个窗口，各国(地区)球迷在这里欢聚一堂。国际足联主席因凡蒂诺说:\"俄罗斯世界杯是历史上最棒的一届。世界杯改变了全世界对俄罗斯的看法，每个球迷都体会到了俄罗斯人的热情。\"\r\n中国元素闪耀世界杯中国足球需奋勇直追\r\n虽然中国队在2002年世界杯上昙花一现，但中国元素却未曾缺席。从中国制造到中国企业和中国品牌，再到中国服务，中国元素再度闪耀世界杯。\r\n来到俄罗斯，\"中国制造\"随处可见。中国企业全力出击，成为国际足联赞助商方阵中举足轻重的力量。万达集团与可口可乐、阿迪达斯、现代汽车等七家企业成为全球合作伙伴;蒙牛、VIVO和海信，与麦当劳、百威啤酒一道成为世界杯赞助商;雅迪、指点艺境和帝牌等企业是区域赞助商。\r\n俄罗斯世界杯赛场内外，中国元素越来越多。不过，中国队未能出现在本届世界杯赛场上，难免令人感到遗憾。毕竟，球队才是这场世界足坛盛宴的真正主角。\r\n面对风云变幻的世界足坛，中国足球需继续锐意改革，以开放的心态学习世界足坛先进的技战术，\"请进来，走出去\"。至关重要的是，需要紧抓青训，打好基础，努力奋斗，久久为功，沿着适合自身发展的道路奋勇直前，中国队实现再次踏上世界杯赛场的梦想就不再遥远。', 'success', 83),
(2, '盘点：2018俄罗斯世界杯的赢家与输家', '2018-7-27', 5, '123456', '法国队赢得了世界杯，但故事还远不止如此。在本届赛事中，很多球员和球队都表现得卓荦不凡，也有的则铩羽而归。以下我们将为您盘点2018年世界杯上的一些赢家和输家。\r\n\r\n赢家\r\n\r\n克罗地亚\r\n\r\n把一支刚刚输掉历史上最重要比赛的球队称之为赢家有些奇怪，但是在过去一个月里，除了最后没能举起大力神杯，克罗地亚人已经做到了他们能做的一切。这个只有400万人口的国家在本届比赛中接连战胜了尼日利亚、阿根廷、冰岛、丹麦、东道主俄罗斯以及英格兰，这样的表现注意留名史册。卢卡-莫德里奇捧得金球，而身价提升最大恐怕还得属中场伊万-佩里西奇。尽管他在决赛中的手球不乏争议，但这名国米悍将如今有望高价转会到对他垂涎已久的曼联。\r\n\r\n比利时\r\n\r\n人们都期待比利时有朝一日能取得突破，他们也终于在本届世界杯上做到了——“欧洲红魔”于1/4决赛中战胜巴西，冲进了四强。有些国家的“黄金一代”显得名不副实；而比利时虽然没能夺冠，但球队的表现显然已经达到了预期。\r\n\r\n日本\r\n\r\n虽然被分到了一个比较难对付的小组，但日本队首战便击败了哥伦比亚，最终涉险晋级。在淘汰赛中，他们一度以2-0领先比利时，无奈还是在体力耗尽后遭到逆转。值得一提的是，“蓝武士”是唯一一支小组出线的亚洲球队。\r\n\r\n基利安-姆巴佩\r\n\r\n足球迷们本就已经很了解姆巴佩了，而本届世界杯则使他真正为世人所熟知。姆巴佩一共打进4球，并且在19岁的年纪就举起了大力神杯。随着梅罗日渐老去，他有望成为足坛的下一代天王巨星。在transfermarkt（德国“转会市场”网）的最新球员身价排名中，姆巴佩以1.4亿美元的身价高居第六，但要想把他带走，这个价钱还远远无法打动巴黎圣日耳曼。\r\n\r\n俄罗斯\r\n\r\n开赛之前，俄罗斯是本届世界杯上排名最低的参赛队，但他们成功地利用主场优势一路打进八强，取得了后苏联时代的最佳成绩。尽管在赛前有评论员发出了担忧的声音，可身为东道主的俄罗斯最终举办了一届和平、顺利又愉快的世界杯，并赢得了大多数人的积极评价。\r\n\r\n丹尼斯-切里舍夫\r\n\r\n切里舍夫直到最后关头才入选了俄罗斯队的大名单，在阿兰-扎戈耶夫因伤下场之前，人们甚至想不到他将获得出场机会，但最终他在本届杯赛上独进4球。美中不足的是，有媒体明显错误地引用了他父亲的话，谬传切里舍夫曾注射过生长激素。\r\n\r\n塞尔盖-米林科维奇-萨维奇\r\n\r\n可能你没有注意到这名来自塞尔维亚的中场球员，但是很多欧洲豪门都注意到了。据传曼联和切尔西等队都想从拉齐奥将他引进。\r\n\r\nVAR（视频助理裁判）\r\n\r\n不是所有的决定都会得到一致的赞扬，但是VAR系统反应迅速，并且纠正了许多误判。在未来的比赛中，我们还将更多地看到它的出现。\r\n\r\n盘点：2018俄罗斯世界杯的赢家与输家\r\n输家\r\n\r\n非洲\r\n\r\n没有人期待着来自非洲的球队最终夺冠，但人们普遍认为五支参赛队中会有一到两支进入淘汰赛。然而，他们只交出了3胜2平10负的总*河蟹*。塞内加尔的表现还算可圈可点，“特兰加雄狮”击败了波兰，但最终因为黄牌数的劣势被淘汰出局。非洲球队的糟糕表现可不是什么好兆头：世界杯将于2022年或者2026年扩军到48队，届时会有9支非洲队伍参赛，而布基纳法索（目前在非洲排名第九）又将表现如何呢？\r\n\r\n德国\r\n\r\n2014年世界杯上，德国队曾以7-1狂胜巴西，并且最终夺冠，四年之后他们却一败涂地。德国队的控球率很高，场均射门数更是傲视群雄，只是他们准星不足，仅仅打进两球。最终“日耳曼战车”以一胜两负的成绩早早出局，末战他们更是耻辱地不敌前两轮全败的韩国队。\r\n\r\n墨西哥\r\n\r\n身处一个艰难小组的墨西哥队表现不错，并最终成功出线。随后他们在淘汰赛中遭遇巴西，因此输球也没什么丢人的。然而这已经是他们连续第七次折戟16强，墨西哥球迷非常渴望打破这一魔咒——也许就在下一届吧。\r\n\r\n巴拿马\r\n\r\n0-3、1-6、1-2。巴拿马在去年的世预赛上力压美国，喜迎自己的第一次世界杯之旅，但是他们三场比赛均表现糟糕，最终在32支球队里叨陪末座。\r\n\r\n莱昂内尔-梅西\r\n\r\n毫无疑问，梅西是有史以来最伟大的球员之一，但是很多人都说，要想成为公认的历史最佳，他需要赢得一次世界杯。阿根廷队在本届杯赛中的发挥乏善可陈——他们先是战平了冰岛，随后又输给了克罗地亚，最终以3-4不敌法国被淘汰出局。而等到2022年的时候，梅西就35岁了。\r\n\r\n内马尔\r\n\r\n没有人会为内马尔感到遗憾，他是世界上最有价值（也是最富有）的球员之一。巴西队在本届世界杯上未能实现自己的目标，内马尔的两粒进球和一次助攻也没有给人留下很深的印象。更加糟糕的是，他常被视作最爱假摔的球员之一，这对于他的形象可没什么帮助。\r\n\r\n福克斯体育台\r\n\r\n每隔四年，我们都要吐槽美国地区的世界杯英文转播报导，今年也不例外。球迷们抱怨福克斯体育台只派出了两队人马前往俄罗斯，剩下的比赛都在洛杉矶的演播室中放送（他们在赛事期间增派了第三支报导队伍）。此外，由于美国队缺席的缘故，本届世界杯的收视率也一路萎靡。', 'success', 25),
(3, '刘语熙长文回顾本届世界杯', '2018-8-1', 7, 'try', '北京时间7月16日凌晨，法国在俄罗斯世界杯决赛中击败克罗地亚，夺得队史第二次世界杯冠军，俄罗斯世界杯正式落下帷幕。之后，某节目主持人刘语熙在微博发长文回顾了她印象中的本届世界杯，她在文中评价了本届世界杯的多场经典之战，并在文末表示，四年一届的世界杯就像是时间的刻度，漫长的等待，而结束也如此猝不及防。这是她自己，或许也是“我们”共同的回忆。\r\n刘语熙原文如下：\r\n\r\n2018俄罗斯世界杯，以东道主5-0拉开序幕。\r\n\r\n6月16号，西葡大战，双牙死磕，c罗戴帽，这大概是本届世界杯的第一场高光比赛。\r\n\r\n6月22号，巴西2-0哥斯达黎加，90分钟常规时间内，哥队以顽强的防守，差点将五星巴西逼入绝境。\r\n\r\n去年夏天我在哥斯达黎加，我喜欢那里。打招呼时就说“puravida”意为“纯净地生活”，这是哥国的问候语。那些天，我在热带雨林徒步，在火山地区骑马旅行，左手拎缰绳，右手一壶矿泉水，觉得自己是武侠小说里的人，快意恩仇大概就是这种感觉。我们终此一生就是要摆脱他人的期待，找到真正的自己，生活本该就是纯净。\r\n\r\n我没有在说比赛，更像在自省。\r\n\r\n6月24号凌晨，德国2-1瑞典，平局僵持，德国命悬一线，补时阶段克罗斯任意球绝杀。\r\n\r\n体育，竞技场，之所以感染到我，是因为能看到那种不到最后一秒不放弃。这是一个结果论的年代，别人看结果，但过程属于自己，对自己最大的尊重是拼尽全力！\r\n\r\n6月24号晚，英格兰6-1巴拿马，本届世界杯单场最大比分，英格兰球迷很快乐，巴拿马人亦是。世界杯赛场上第一粒进球，巴洛伊倒地铲射破门后，场边有个人举起双手欢呼，我被那憨厚的笑容打动，巴拿马队主帅，埃尔南·戈麦斯。你看看，其实不用和别人比，好好活自己，就好。\r\n\r\n6月26号，B组最后两场比赛，让人意外的是，毫无出线可能的摩洛哥让西班牙陷入苦战。比赛接近尾声时，依然没有谁能锁定出线。如果伊朗队补时阶段塔雷米将球打入，伊朗会是小组第一，西班牙第二，葡萄牙淘汰。\r\n\r\n我去年在EBC徒步路上，偶遇一个大姐，登山家，来自摩洛哥。到了珠峰大本营后我俩帐篷挨着，我说等你登顶成功，等我浪到非洲时我们摩洛哥见吧，这是一个约定。一个月后我在拉巴特见到了她，她成功登顶，两个手指轻度冻伤，已算幸运。她说，那天凌晨，准备登顶时，非生即死，一刹那间，命运改写。\r\n\r\n就像这两场比赛，霎那间，反转。\r\n\r\n6月27号凌晨，阿根廷2-1尼日利亚。这事得从22号说起，尼日利亚2-0击败冰岛，为阿根廷保留出线机会。27号，冰岛不敌克罗地亚，阿根廷绝杀尼日利亚，欧洲杯上的黑马回家，阿根廷磕磕绊绊出线，自助者，天助之。\r\n\r\n6月27号晚，德国0-2韩国，好像很少有人会担心那晚的比赛，毕竟对手是韩国。这届世界杯进行到当时，最大的冷门。\r\n\r\n两年前在慕尼黑见到德国队老队长巴拉克，和他聊了很多，他的成长经历，退役后的生活。其中有一段话印象深刻，他说-“当你的事业进入瓶颈期，千万不要认为这就是终点，你需要停下来思考，去越过这道坎，一旦跨过这个关卡，你会变得更优秀，更强大。”这是他当时的原话，很适合送给那晚的德国队。\r\n\r\n6月30号，淘汰赛正式开始。\r\n\r\n如果说前半个月还像小时候，犯错了还给你改正的机会，今天突然就成年了，错了就回不了头，人生就是没有倒带啊。\r\n\r\n上一届亚军阿根廷，上上届冠军西班牙相继出局。\r\n\r\n阿根廷最南端的城市，乌斯怀亚，被称为“世界尽头”。那里一家餐厅的外墙上写着各国语言对于这座城市名字的翻译，英语写的是“Theendoftheworld”，中文是“世界末日”，我和朋友开玩笑说这家餐厅会吓走中国人。但别忘了，那里也是登船去南极的地方，是尽头也是港口。\r\n\r\n重新起航吧，阿根廷足球。\r\n\r\n7月1号，葡萄牙1-2负于乌拉圭，无缘八强。\r\n\r\n上届世界杯结束后我去到了葡萄牙罗卡角，欧亚大陆最西端，天涯海角，那里的石碑上写着葡萄牙诗人卡蒙斯的一句诗词-“陆止于此,海始于斯”，那是一段属于探险家的历史。\r\n\r\n这届世界杯在那天送别了两大巨星，梅西，C罗，结束和开始往往一起到来，是终点也是起点。\r\n\r\n7月2号，丹麦3-4负于克罗地亚，小舒梅切尔也成为有点球大战历史以来，唯一一个在一场比赛中扑出三个点球但球队未能取得胜利的门将。\r\n\r\n7月3号比利时3-2日本，即便猜中了结果，但无法猜到过程。日本队两球领先，但最终比利时连入3球扳回败局，\r\n\r\n那天有人问我为什么那么多人爱看足球，我说大概是因为能看到团结，拼搏，未知，刚才都看到了！足球是圆的。日本队，输了比赛，赢得了尊重。\r\n\r\n7月7号巴西1-2比利时，如果说德国，阿根廷，巴西的出局有什么相似性的话，可能因为他们都是在喀山体育场。\r\n\r\n之前我在俄罗斯呆了一个月，去了这届世界杯十一座举办城市的其中十座，除了喀山。这真是座神奇的城市。世界杯从这天开始正式变为了欧洲球队的表演。\r\n\r\n7月12号克罗地亚2-1英格兰，又是一场120分钟的鏖战，克罗地亚在本届世界杯的第三场加时赛，这6万平方公里的国度，这420万人口，他们的坚韧是淬炼过的。\r\n\r\n达利奇赛后说-“我想要换人，但没人愿意被换下。”顽强的意志力，顽强的克罗地亚队，创造历史。\r\n\r\n7月15号法国4-2克罗地亚，听到这个比分，还以为在说3、4名决赛。无论大家觉得比赛的拐点是在曼朱基奇的那个乌龙，还是VAR改判的那粒点球，终场哨音吹响，尘埃落定。\r\n\r\n克罗地亚和冠军擦肩而过，高卢雄鸡添星捧杯。\r\n\r\n四年一届的世界杯就像是时间的刻度，漫长的等待，而结束也如此猝不及防。这是我自己，或许也是“我们”共同的回忆。', 'pending', 7),
(4, '世界杯赞助商品牌CGI榜出炉，中国赞助商投巨资后品牌效果成了笑话？', '2018-8-2', 8, '111111', '7月16日凌晨，充满奇幻色彩的2018年世界杯终于结束了。此前白岩松曾吐槽：“这届世界杯，中国除了国足没去，其他都去了！”这句玩笑话说出了中国企业对“世界杯”的热衷。根据FIFA官方公布的赞助商名单，本届世界杯15家官方赞助商中，有7家是中国品牌。\r\n\r\n投入巨资赞助世界杯的中国品牌获得的效果如何？7月17日，封面新闻、中译语通和封面智库联合发布的《世界杯赞助商品牌CGI榜》解答了这个问题。\r\n\r\n世界杯赞助商品牌CGI榜出炉，中国赞助商投巨资后品牌效果成了笑话？\r\n榜单对2018年世界杯比赛前后的品牌相关数据进行了统计分析，发现7家中国品牌中，服装企业帝牌通过赞助世界杯获得了最大的品牌影响力提升，其CGI增长了852.24%。而最亏的则是智能硬件企业Luci，这家公司的CGI只增长了6.28%。\r\n\r\nCGI是通过对全球公开大数据进行专业深度的分析，计算出的各大品牌综合影响力指数，也是目前唯一的以全球开源大数据作支撑，定期发布更新的品牌大数据榜单。\r\n\r\n中国品牌可能成了冤大头\r\n\r\nFIFA公布的官方赞助商中，7家中国企业分别是万达、蒙牛、海信、VIVO、雅迪、帝牌、Luci。据市场研究公司Zenith的调查显示，来自中国的品牌在2018年世界杯期间的广告投入达8.35亿美元（约合人民币55.8亿元）。\r\n\r\n有报道称，本届世界杯战略伙伴之一的万达支付的赞助费为1.5亿美元，蒙牛则花了5000万美元买了一个官方赞助商名额。\r\n\r\n但是从《2018年世界杯赞助商品牌CGI榜》中发现，并不是每一家中国品牌赞助商花出去的钱都带来了很好的品牌效果提升。\r\n\r\n具体来看，服装企业帝牌通过赞助世界杯获得了最大的品牌影响力提升，其CGI增长了852.235%。有意思的是帝牌买的是最便宜的“世界杯区域赞助商”名额，约为2000万美元左右。\r\n\r\n相比之下，作为最贵的战略合作伙伴之一，万达的性价比就比较低了。它CGI增长率为21.7%。但是万达不用太伤心，因为vivo和蒙牛的CGI增长也不高，分别是9.43%和11.2%。\r\n\r\n总体来看，7家中国赞助商的品牌效果呈现出严重的两级分化。帝牌和海信的CGI增长率超过200%，而另外的5家CGI增长率都不超过50%。从这样的效果来看，赞助本次世界杯的大部分中国企业着实是当了一次“冤大头”。\r\n\r\n不过中国企业也不要太沮丧，因为如果和海外的赞助商品牌相比，中国的品牌CGI增长率并不显得特别惨淡。比如麦当劳的CGI也只是增长了7.57%。\r\n\r\n当世界杯赞助商有学问\r\n\r\nCGI大数据研究院分析师认为，帝牌之所以有如此高的增长，客观上是因为赞助世界杯之前其品牌的全球影响力是7家赞助商里最低的。\r\n\r\n此外，帝牌赞助世界杯也是找到了一个已经比较成熟的品牌结合点切入的。事实上，世界杯历来是型男出没、消费男色的超级舞台，国际一线的男装品牌一直把世界杯看作是展示实力的赛场。德国队穿的西装由德国一线品牌Hugo Boss赞助，冠军法国队身穿的西装来自法国高级定制西装品牌Francesco Smalto。\r\n\r\n相比之下，最亏的世界杯赞助商Luci获得最差的品牌效果也在意料之中了。分析师认为，Luci的主力产品VR头显设备目前和世界杯的结合并不紧密，在世界杯中还找不到一个很好的应用场景。\r\n\r\nCGI大数据研究院分析师认为，对于品牌传播渠道利用不当也是中国企业失利的重要因素。榜单数据显示，大部分中国赞助商在利用世界杯进行品牌传播时，对微博、微信、Twitter、Facebook等社交媒体平台利用并不充分。\r\n\r\n比如蒙牛在世界杯期间，全球社交媒体平台上的用户关注量增长仅为10.8%，vivo的也仅提高了23%。而帝牌和海信这两个“赞助商赢家”的社交媒体用户关注量增长分别为648%和595%。\r\n\r\n虽然从短期来看，中国企业并没有沾到世界杯的光。但品牌建设是一个持续长久的过程，世界杯给中国赞助商们带来的品牌效应到底如何，中国品牌投入的巨资究竟值不值，也许只有时间才能给出答案了。', 'pending', 1),
(5, '2018世界杯颜值最高的四位球星，内马尔排名垫底，第一无可厚非！', '2018-8-2', 7, 'try', '内马尔是巴西队的领军人物，他代表着巴西队的荣耀。世界杯上他的表现很出色，就是“七连滚”有点败人品，其他方面还可以。失利后他相当自责，在场边哭泣的身影实在可怜。他是巴西历届颜值最高的，不过到了世界上就垫底了。\r\n\r\n\r\n\r\nJ罗是哥伦比亚的球星，他的足球生涯并不顺利，曾经一度低迷。后来他在世界杯上证明了自己，状态一直很好。他的女粉丝也很多，颜值和贾斯汀比伯有的一拼。\r\n\r\n\r\n\r\n格里兹曼是法国队的球星，他的球风彪悍，总能在对方不防备时抓住机会，在后期他也能保持很好的跑动，在最后的关头也不放弃。他的长相很有法国人的气质，帅气的脸庞和浪漫的眼神都能俘获不少女粉丝的心。\r\n\r\n\r\n\r\n罗伊斯是来自德国队的球员。他一脸文质彬彬的样子，很有贵族王子的气质。他打球时的技术很好，利用稳扎稳打的球技征服观众。这样一个有风度的丸子球星，谁不喜欢呢，颜值绝对是第一的。', 'pending', 1),
(6, '披着世界杯外衣的春晚结束了 中国足球终于喘口气', '2018-8-1', 5, '123456', '在一片争吵、感叹和不舍中，世界杯告一段落，可能很多人没注意，中超后半程的比赛明天就将开始。\r\n\r\n　　对于中国足球来说，不堪其扰的一个月终于过去了，喘口气吧。\r\n\r\n　　世界杯从某种性质来讲和春晚很像，二者都在一个特殊的时间节点把中国人聚拢，不管你是工人还是公务员、不管你是贫穷还是富庶、不管你是男是女，在这段时间里，你们看到的是一样的场景，你们听到的是一个声音，你们思考的是一个问题。\r\n\r\n　　不管春晚已经多无聊，不管世界杯已经多沉闷，但人们还是如期而至的收看。\r\n\r\n　　略带不幸又命中注定的是，中国足球总是那个被围而攻之的活靶子，逃不开，躲不过。\r\n\r\n冯巩牛群的相声讽刺国足冯巩牛群的相声讽刺国足\r\n　　从91年冯巩牛群的“什么最香？”“亚运村饭菜最香。”“什么最臭？”“中国男子足球队临门一脚，那脚最臭。”，到后来黄宏那句“这一年看完甲B看甲A，最可气的世界杯，天天喊着能出线，到后来，狗戴嚼子瞎胡勒。”，中国足球，或者具体而言的国足，一直是阖家团圆茶余饭后的笑柄，调侃国足甚至成了春晚的政治正确。\r\n\r\n骂国足臭有很多年历史骂国足臭有很多年历史\r\n　　劳碌了一整年的人们，需要这么一个发泄口，把那些疲惫、抱怨和辛酸付之一笑，在短暂的欢乐中忘却生活的艰难。\r\n\r\n　　作为业内最高的标杆和民众期盼的顶峰，世界杯是中国足球绕不开的痛，到了这个当下，所有的揶揄嘲讽都到了极致。\r\n\r\n台湾媒体说球员像白切鸡台湾媒体说球员像白切鸡\r\n　　以球迷身份示人的白岩松说，“除了国家队，中国其他的都去了世界杯”，字字诛心；台湾媒体拿出好早以前的老黄历，说中国球员就像“白切鸡”，可笑的是他们连王永珀踢什么位置都弄错了；一个脱口秀演员也来蹭热度，发微博要求国足解散，此举惹怒了所有中国足球从业者。\r\n\r\n　　其他人更是不停的把世界杯往国足身上套。先来一波冰岛的“业余球员”，再来一波战乱的克罗地亚，日本队收拾更衣室更是被大肆宣传……不管事实也好，鸡汤也罢，一切的一切都是告诉国足一句话：\r\n\r\n　　看看人家！你怎么就不行？！\r\n\r\n　　拿这些来寒碜国足的人们，大多是起哄架秧子的，他们甚至没怎么看过足球，人云亦云，目的只是为了找个痰盂儿发泄；也确有不少真正为国足操心的人，恨铁不成钢的心态让他们失去理智，但谩骂和攀比能解决问题吗？\r\n\r\n血泪一般的中国足球血泪一般的中国足球\r\n　　换位思考，哪个人都不愿意自己的家长拿着别人家孩子说事，“你看XXX，今天又考第一，你呀你呀，怎么就这么废物？”，这是一句多么伤人自尊的话语。\r\n\r\n　　说现实一点，足球不过是国脚们一份工作，他们确实在领域内没达到顶尖水准，但想想脱口而出的我们，又有几个是各自行业的标兵？总质疑人家没有职业性，但我们又有几个不是上班时间磨洋工、开小差呢？把一盆脏水泼到国足身上，还得要求国脚们实力不行就老老实实接着，那要是有人说我们消极怠工的时候，是不是也得克制住别跳着脚骂街？\r\n\r\n少点讽刺谩骂少点讽刺谩骂\r\n　　中国足球真正需要的是科学而又持续的关注和建议，并非是春晚和世界杯时的讥讽，之后又置之不理的态度。\r\n\r\n　　这些道理早就被呼吁了很多年，而且一遍一遍的重复，但情况依旧没改观。\r\n\r\n　　看着，等明天中超重新开始后，肯定有人说：看惯世界杯了，这是什么垃圾玩意？', 'success', 6),
(7, '大数据回顾世界杯，小鲜肉姆巴佩跻身流量球员Top5', '2018-7-21', 7, 'try', '世界杯虽已落幕半月，但随着C罗来华，厄齐尔退队等新闻，足球依然是这个夏天最受关注的运动。QQ浏览器也于近日发布了《2018世界杯直达数据报告》，与用户一同回顾足球魅力。据统计，用户在世界杯期间通过搜索直达获取的信息超过两千万人次，浏览器内互动量达19亿。该报告还发布了人气排行、观众群像、趣味榜单等，其中克罗地亚队超过冠军法国队成为最受关注的球队，小将姆巴佩一匹黑马成为人生赢家。\r\n\r\nQQ浏览器搜索直达大数据回顾世界杯，小鲜肉姆巴佩跻身流量球员Top5\r\n\r\n　　世界杯期间，QQ浏览器搜索直达上线了世界杯相关的服务卡片，提供世界杯赛程、射手排行、球员介绍等最新世界杯信息，截止到7月15日，用户通过搜索直达获取世界杯信息超两千万次，节省下来的搜索时间可以再举办两次世界杯。同时，QQ浏览器还在首页上线了“世界杯”专区，提供更多世界杯内容和互动平台，共产生了30万条内容，19亿次互动。\r\n\r\n　　报告首先揭秘了世界杯人气榜，克罗地亚超越冠军法国队成为最受关注球队，而比利时和英格兰这两支四强队伍都被遗忘在了五名之外。早早淘汰出局的“网红”冰岛队则人气不减，居于第四。其中，5月16日逼平阿根廷使冰岛队赢得了最高关注度，为世界杯期间最高。与此同时，德国却以完全相反的方式震惊网友，爆冷输给韩国队，这让德国队球迷成为最想上“天台”的球迷。\r\n\r\nQQ浏览器搜索直达大数据回顾世界杯，小鲜肉姆巴佩跻身流量球员Top5\r\n\r\n　　球员方面，C罗和梅西的关注度比其他球员加起来多，其中C罗小胜，成为当之无愧的流量王，而小鲜肉姆巴佩也成在世界杯中揽足人气，杀入前四，成为人生赢家。\r\n\r\nQQ浏览器搜索直达大数据回顾世界杯，小鲜肉姆巴佩跻身流量球员Top5\r\n\r\n　　对球迷的数据分析显示，男球迷撑起了大半边天，平均每五个球迷中只有一个是女球迷。而一线城市北上广的球迷也稳居一线，活跃度分列前三。而令人惊讶的是，世界杯里最活跃的球迷竟是IT工程师和设计师，网友笑称整个世界杯里，就是他们深夜维护着平台让网友有槽可吐，赶着方案让品牌有营销可做。\r\n\r\nQQ浏览器搜索直达大数据回顾世界杯，小鲜肉姆巴佩跻身流量球员Top5\r\n\r\n　　歪姿势榜单中，则统计了世界杯期间的网络热词，包括掀起网友P图热潮的#慌得一批# 和#天生要强#，还揭秘了“伪球迷”问得最多的三个问题，法国队7号，堪称对内颜值担当加罚球担当的格里兹曼就被“点号”询问了。\r\n\r\nQQ浏览器搜索直达大数据回顾世界杯，小鲜肉姆巴佩跻身流量球员Top5\r\n\r\n　　在品牌营销战役中，华帝一战成名，成为用户搜索直达最多的品牌，而凭借知乎洗脑4连问广告位居第二，阿迪达斯虽然赞助的队伍全灭，但关注度依然不错。\r\n\r\n', 'pending', 3),
(8, '法国锁定下届世界杯小组出局？德国的衰他们不怕', '2018-7-30', 8, '111111', '法国的青春风暴终于修成正果！2014、2016年两届大赛与冠军擦肩而过后，这批球员站上了世界之巅。但可怕的是，这才刚刚开始。\r\n\r\n　　两年前，法国队在家门口把欧洲杯冠军拱手让给了葡萄牙，这让他们痛定思痛。两年之后，这支法国队在大框架不变的情况下，阵容上还有所增强，尤其是姆巴佩的横空出世，给法国锋线带来了很大的提升。\r\n\r\n　　年纪轻轻的他们已经达到了巅峰，而在世界杯夺冠后，很难不让人想象他们未来的样子。\r\n\r\n　　本届世界杯，德国队意外从小组出局，这引出了最近几届世界杯的一个魔咒：卫冕冠军总是没有好下场。上届世界杯，卫冕冠军西班牙小组出局；2010年世界杯，意大利小组出局；而2002年，是法国队没能从小组出线。20年间只有巴西队逃过此劫。\r\n\r\n卫冕冠军魔咒卫冕冠军魔咒\r\n　　2014年的西班牙，在大赛三连冠之后，其衰落已有迹可循，2010年的意大利也是如此。最让人想不到的就是今年的德国队了，他们基本采用了4年前夺冠的主力架构，人才储备强大，连萨内、瓦格纳这样的实力球员都无法进入世界杯大名单……去年联合会杯，他们轻松以二队出马夺冠，在本届世界杯开幕之前，德国可谓是最大热门之一。\r\n\r\n　　但谁也不知道德国本届世界杯如此低迷的真正原因，是战术打法，人员配置，还是球员们的心气不高了？也许都有。在上届夺冠后，德国足球看起来一直非常强势，但事实上他们并没有展现出像西班牙王朝那样的持续统治力。\r\n\r\n　　那么问题来了，法国队之后4年的命运会如何呢？他们会不会再身陷卫冕冠军魔咒，重蹈德国队的覆辙？\r\n\r\n　　如果只看阵容，那法国在2年后的欧洲杯和4年后的世界杯上只会更加恐怖。看看这支世界杯夺冠的法国队，平均年龄只有26岁，23人名单中25岁以上的球员只有8人，其中曼丹达、拉米、恩宗齐本来就是角色球员。而在中前场，姆巴佩、登贝莱、勒马尔、托利索还有的是提升空间，4年后甚至8年后，他们都值当打之年。别忘了，在大名单之外，还有科曼、马夏尔、拉比奥特等才华横溢的年轻球员们虎视眈眈。人才方面，法国至少在4年后不会有什么断层。\r\n\r\n25岁以上的法国国脚25岁以上的法国国脚\r\n更多的是25岁及以下的年轻球员更多的是25岁及以下的年轻球员\r\n　　相比于德国，法国的后备力量更加可怕，而他们需要的就是保持状态和野心。今年9月份开始的欧洲国家联赛对于法国来说会是很好的试验，比赛涉及强队之间的比拼，涉及升降级，需要球队拿出真本事，这能让他们保持狼性。再经过一年的预选赛，欧洲杯就要开打，法国的目标毫无疑问是复制2000年前辈们先夺世界杯后再夺欧洲杯的伟业。\r\n\r\n　　对于法国队的年轻人们来说，世界杯夺冠已经志得意满，但还有更加辉煌的未来等待他们创造。若能实现世界杯卫冕，那他们就会成为被载入史册的伟大球队。', 'success', 2);
